import React from 'react';
import TodoList from './TodoList';
import TodoInput from './TodoInput';
import './Todos.css'

const Todos = () => {
    return (
        <div className="Todos">
            <h1>Todo List</h1>
            <TodoInput/>
            <TodoList/>
        </div>
    );
};

export default Todos;
